import React from 'react';
import { Container } from './styles';

const SixthSection: React.FC = () => {
  return (
    <Container>
      <div className="contact">
        <h5>Contato</h5>
        <h4>Telefone: 11 96403-2001</h4>
        <span></span>
        <h6></h6>
      </div>
      <div className="form"></div>
    </Container>
  );
};

export default SixthSection;
